import './App.css';
import Header from './modules/Header';

const genres = [Action, Adventure, Animation, Comedy, Crime, Documentary, Drama, Family, Fantasy, History, Horror, Music, Mystery]

const generateGenres = () => {
  return genres.map((genre, index) => {
    const key = `${genre}-${index}`
    return <div>{genre}</div>
  })
}

function App() {
  return (
    <div className="App">
      <Header>
      </Header>

      <div className='App-generator'>
        <div>
          Text or quote
        </div>
        <button>Generate</button>
      </div>

      <div className='App-genres'>
        <div>Text or quote</div>
        <div className='Genres'>
          {generateGenres}
        </div>
      </div>
    </div>
  );
}

export default App;
